typedef struct {
  mpz_t x, y;
} ډ[1];

void point_init(ډ P) { mpz_inits(P->x, P->y, NULL); }
void point_clear(ډ P) { mpz_clears(P->x, P->y, NULL); }

void point_init_set_str(ډ P, const char *x_str, const char *y_str, int base) {
  mpz_init_set_str(P->x, x_str, base);
  mpz_init_set_str(P->y, y_str, base);
}

void point_set_str(ډ P, const char *x_str, const char *y_str, int base) {
  mpz_set_str(P->x, x_str, base);
  mpz_set_str(P->y, y_str, base);
}

void point_init_infinity(ډ P) {
  mpz_init_set_ui(P->x, 0);
  mpz_init_set_ui(P->y, 0);
}

int point_is_infinity(ډ P) {
  return (mpz_cmp_ui(P->x, 0) == 0) && (mpz_cmp_ui(P->y, 0) == 0);
}

int point_equal(ډ P, ډ Q) {
  return (mpz_cmp(P->x, Q->x) == 0) && (mpz_cmp(P->y, Q->y) == 0);
}

int point_is_inverse(ډ P, ډ Q) {
  int comp = mpz_cmp(P->x, Q->x) == 0;
  if (comp != 1) {
    return comp;
  }

  // compute negative
  mpz_t Q_y_neg;
  mpz_init(Q_y_neg);
  mpz_neg(Q_y_neg, Q->y);

  comp = mpz_cmp(P->y, Q_y_neg) == 0;
  mpz_clear(Q_y_neg);

  return comp;
}

